            // check if checkbox is checked
            for (var i = 0; i < checkboxArray.length; i++) {
                if (checkboxArray[i].checked)
                    ids.push(checkboxArray[i].value);
            }

            // submit form
            if (ids.length > 0) {
                if (confirm(""Are you sure you want to delete this item(s)?"")) {
                    form.submit();
                }
            }
        });

