                $('#' + id).iCheck('toggle');
            }
        });

        // icheck highlight selected
        $('input').on('ifChecked', function (event) {
            var row = $(this).closest('tr');
            if (!row.hasClass('selected'))
                row.toggleClass('selected');
        });

        $('input').on('ifUnchecked', function (event) {
            var row = $(this).closest('tr');
            if (row.hasClass('selected'))
